import React from 'react'

export default function Todo({ todo, toggleTodo }) {
  function handleTodosClick() {
    toggleTodo(todo.id)
  }

  return (
    <div>
      <label>
        <input type="checkbox" checked={todo.complete} onChange={handleTodosClick} />
        {todo.name}
      </label>
    </div>
  )
}
